import React from 'react';
import {robots} from './robots.js';

const imgArr = [
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'},
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'},
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'}
]

const textB = [
	' and more on the way',
	' and counting',
	' added, ' + Math.round(Math.random()*1000000) + ' to go'
]

const num = () => {
	return Math.round(Math.random()*(imgArr.length-1));	
}

const Banner = (props) => {
	return (
		<div>
			<div id='spacer'>{robots.length + ' resources' + textB[2] + '...'}</div>
			<div id='banner' title={imgArr[num()].text}></div>
		</div>
	);
}

export default Banner;
